






CREATE TABLE "sample_booklets" (
  "id" INTEGER NOT NULL,
  "order_number" varchar(100) NOT NULL,
  "customer_name" varchar(255) NOT NULL,
  "address" text NOT NULL,
  "email" varchar(255) NOT NULL,
  "phone" varchar(20) NOT NULL,
  product_type TEXT CHECK (product_type IN ('Demo Kit & Sample Booklet', 'Sample Booklet Only', 'Trial Kit', 'Demo Kit Only')) NOT NULL,
  "tracking_number" varchar(100) DEFAULT NULL,
  status TEXT CHECK (status IN ('Pending', 'Shipped', 'Delivered')) DEFAULT 'Pending',
  "date_ordered" date NOT NULL,
  "date_shipped" date DEFAULT NULL,
  "notes" text DEFAULT NULL,
  "created_at" timestamp NOT NULL DEFAULT now(),
  "updated_at" timestamp NOT NULL DEFAULT now() ON UPDATE now()
) ;





